#include <iostream>


using namespace std;
bool isSubsequence(string &s, string &t)
{
	size_t m = s.size();
	size_t n = t.size();
	size_t index = 0;
	for(size_t i = 0; i < n; ++i)
	{
			if(s[index] == t[i])
			{
				index ++;
			}
	}
	if(index == m)
	{
		return true;
	}
	else
	{
		return false;
	}

}

int main(int argc, char * argv[])
{
	string a = "leeeeetcode";	
	string b = "";
	if(isSubsequence(a,b))
	{
		cout<<"yes"<<endl;
	}
	else
	{
		cout<<"no"<<endl;
	}

}

